import "bootstrap/dist/css/bootstrap.min.css";
// import "./assets/styles/Navbar.sass";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faUserCircle } from "@fortawesome/free-solid-svg-icons";
import logo from "./assets/logo.jpg";
import React, { useState } from "react";
import { NavDropdown } from "react-bootstrap";
import { Button, Modal } from "reactstrap";
// import ModalSignUp from "./modal-signup";
// import ModalSignIn from "./modal-signin";
// import MovieCard from "./movieCard";
import { Link } from "react-router-dom";
// import { FaWindows } from "react-icons/fa";

const NavBar = () => {
  //states- input query, movies
  const [query, setQuery] = useState("");
  //create the state for movies, and update that state appropriate
  const [clinic, setClinic] = useState([]);

  const [modalSearchClinic, setModalSearchClinic] = useState(false);
  const toggleModalSearchClinic = () =>
    setModalSearchClinic(!modalSearchClinic);

  const searchClinic = async (e) => {
    e.preventDefault();
    const url = `http://54.254.205.124:3000/movie/search/${query}?page=1&limit=20`;
    try {
      const res = await fetch(url);
      const data = await res.json();
      console.log(data);
      setClinic(data);
    } catch (err) {
      console.error(err);
    }
  };
  console.log("testttt", clinic);

  const pic = (
    <FontAwesomeIcon
      icon={faUserCircle}
      size="2x"
      style={{ color: "#FCA311" }}
    />
  );
  const signOut = () => {
    localStorage.clear("token");
    window.location.reload();
  };
  //   const [modalSignUp, setModalSignUp] = useState(false);
  //   const toggleModalSignUp = () => setModalSignUp(!modalSignUp);
  //   const [modalSignIn, setModalSignIn] = useState(false);
  //   const toggleModalSignIn = () => setModalSignIn(!modalSignIn);
  //   const toggleSwitch = () => {
  //     setModalSignIn(!modalSignIn);
  //     setModalSignUp(!modalSignUp);
  //   };

  return (
    <header>
      <div className="navbar-container w-100">
        <div className="navbar">
          <Link to={`/`}>
            <img src={logo} alt="Team G" className="navbar-logo"></img>
          </Link>
          <Link to={`/`}>
            <p>Home</p>
          </Link>
          <Link to={`/`}>
            <p>Chat</p>
          </Link>
          <form className="navbar-search" onSubmit={searchClinic}>
            <input
              type="text"
              name="query"
              placeholder="search for clinic"
              value={query}
              onChange={(e) => setQuery(e.target.value)}
            />
            <Button onClick={toggleModalSearchClinic} type="submit">
              Search
            </Button>
            <Modal isOpen={modalSearchClinic} toggle={toggleModalSearchClinic}>
              <div className="card-list">
                {/* {movies?.data?.map((movie) => (
                  <MovieCard movie={movie} />
                ))} */}
              </div>
            </Modal>
          </form>

          <NavDropdown title={pic} id="basic-nav-dropdown">
            <NavDropdown.Item>Full Name</NavDropdown.Item>
            <NavDropdown.Item href="/profile">Profile</NavDropdown.Item>
            <NavDropdown.Item href="/pagefaq">FAQ</NavDropdown.Item>
            <NavDropdown.Item href="/page-settings">Settings</NavDropdown.Item>
            <NavDropdown.Item onClick={signOut}>
              <Link to="/"> Sign out </Link>
            </NavDropdown.Item>
          </NavDropdown>

          {/* <Button onClick={toggleModalSignUp}>Sign Up</Button>
          <ModalSignUp
            modal={modalSignUp}
            toggleModalSignUp={toggleModalSignUp}
            toggleModalSignIn={toggleModalSignIn}
            toggleSwitch={toggleSwitch}
          />
          <ModalSignIn
            modal={modalSignIn}
            toggleModalSignIn={toggleModalSignIn}
            toggleModalSignUp={toggleModalSignUp}
            toggleSwitch={toggleSwitch}
          /> */}
        </div>
      </div>
    </header>
  );
};

export default NavBar;
